import { Flex} from "@chakra-ui/react";
import { FC, memo } from "react";

export const Footer: FC = memo(() => {
  return (
    <>
      <Flex
        as="nav"
        bg="teal.500"
        color="gray.50"
        align="center"
        justify="space-between"
        padding={{ base: 3, md: 5 }}
        position={"fixed"}
        bottom={0}
      >
        &copy; 2024 yoshinari INC.
      </Flex>
    </>
  );
});
